-- Creazione del database se non esiste
CREATE DATABASE Inventario;

-- Selezione del database
USE Inventario;

-- Creazione della tabella Articoli se non esiste
CREATE TABLE Articoli (
    Id INT PRIMARY KEY IDENTITY(0,1), -- Chiave primaria con incremento automatico
    Nome VARCHAR(255) NOT NULL, -- Nome dell'Articoli
    Descrizione TEXT, -- Descrizione dell'Articoli
    Prezzo DECIMAL(10, 2) NOT NULL, -- Prezzo con precisione di 2 decimali
    QuantitaDisponibile INT NOT NULL, -- Quantit√† disponibile
    CodiceSKU VARCHAR(50) NOT NULL UNIQUE, -- Codice SKU univoco
    Categoria VARCHAR(100), -- Categoria dell'Articoli
    DataInserimento DATETIME2 NOT NULL DEFAULT GETDATE() -- Data di inserimento con valore predefinito corrente
);


